import React from "react";
import styled from "styled-components";

function Section() {
  return (
    <Wrap>
      <ItemText>
        <h1>Real Estate Shark Home</h1>
        <p>Your in dangerious waters, where would you like to go?</p>
      </ItemText>

      <ButtonGroup>
        <FirstButton>Explore Rentals</FirstButton>
        <SecondButton>What's New</SecondButton>
      </ButtonGroup>

      <DownArrow></DownArrow>
    </Wrap>
  );
}

export default Section;

const Wrap = styled.div`
  width: 100vw;
  height: 100vh;
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  background-image: url("/images/solar-panel.jpg");
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;
`;

const ItemText = styled.div`
  padding-top: 15vh;
  text-align: center;
  color: blue;
  animation: animateRound infinite 3s;
`;

const ButtonGroup = styled.div`
  display: flex;
  margin-bottom: 50px;
`;
const FirstButton = styled.div`
  width: 300px;
  color: white;
  background-color: rgba(23, 26, 32, 0.8);
  height: 40px;
  display: flex;
  justify-content: center;
  align-items: center;
  border-radius: 60px;
  opacity: 0.85;
  text-transform: uppercase;
  font-size: 12px;
  cursor: pointer;
  text-align: center;
`;
const SecondButton = styled(FirstButton)``;

const DownArrow = styled.img`
  margin-top: 20px;
  height: 40px;
`;
